import{_ as A,o as z,c as P,b as t}from"./app.2b9aacdc.js";const B={},Q=t('<img src="https://count-viewer.vercel.app//api/blog/view?url=https://creatipath.github.io/illustrator-short/section2.html" alt="Image 1" style="float:left;"><h1 id="_2-huong-dan-su-dung-adobe-illustrator-ai-co-ban" tabindex="-1"><a class="header-anchor" href="#_2-huong-dan-su-dung-adobe-illustrator-ai-co-ban" aria-hidden="true">#</a> 2. H\u01B0\u1EDBng d\u1EABn s\u1EED d\u1EE5ng Adobe Illustrator (AI) c\u01A1 b\u1EA3n</h1><p>D\u01B0\u1EDBi \u0111\xE2y l\xE0 c\xE1c c\xF4ng c\u1EE5 v\xE0 c\xE1c thao t\xE1c th\xF4ng d\u1EE5ng nh\u1EA5t tr\xEAn Adobe Illustrator.</p><p>2.1. C\xF4ng c\u1EE5</p><p><img src="data:image/png;base64," alt="B\u1EA3ng k\xFD hi\u1EC7u tool trong Adobe Illustrator"></p><table><thead><tr><th><strong>T\xEAn c\xF4ng c\u1EE5</strong></th><th><strong>Ph\xEDm t\u1EAFt</strong></th><th><strong>\u1EE8ng d\u1EE5ng</strong></th></tr></thead><tbody><tr><td>Selection Tool</td><td>V</td><td>Cho ph\xE9p ch\u1ECDn b\u1EA5t k\u1EF3 \u0111\u1ED1i t\u01B0\u1EE3ng n\xE0o b\u1EB1ng c\xE1ch k\xE9o ho\u1EB7c nh\u1EA5p v\xE0o \u0111\u1ED1i t\u01B0\u1EE3ng \u0111\xF3.</td></tr><tr><td>Line Segment Tool</td><td>\\</td><td>V\u1EBD nh\u1EEFng \u0111\u01B0\u1EDDng th\u1EB3ng.</td></tr><tr><td>Rectangle Tool</td><td>M</td><td>T\u1EA1o ra c\xE1c h\xECnh ch\u1EEF nh\u1EADt/ h\xECnh vu\xF4ng v\u1EDBi c\xE1c g\xF3c vu\xF4ng.</td></tr><tr><td>Rounded Rectangle Tool</td><td>\xA0</td><td>T\u1EA1o ra c\xE1c h\xECnh ch\u1EEF nh\u1EADt/ h\xECnh vu\xF4ng v\u1EDBi c\xE1c g\xF3c tr\xF2n..</td></tr><tr><td>Ellipse Tool</td><td>L</td><td>V\u1EBD h\xECnh elip v\xE0 h\xECnh tr\xF2n.</td></tr><tr><td>Polygon Tool</td><td>\xA0</td><td>T\u1EA1o h\xECnh \u0111a di\u1EC7n v\u1EDBi b\u1EA5t k\u1EF3 s\u1ED1 c\u1EA1nh mong mu\u1ED1n.</td></tr><tr><td>Star Tool</td><td>\xA0</td><td>T\u1EA1o h\xECnh \u0111a di\u1EC7n v\u1EDBi b\u1EA5t k\u1EF3 s\u1ED1 \u0111i\u1EC3m mong mu\u1ED1n.</td></tr><tr><td>Color Tool</td><td>\xA0</td><td>L\u1EF1a ch\u1ECDn ho\u1EB7c thay \u0111\u1ED5i m\xE0u s\u1EAFc c\u1EE7a \u0111\u1ED1i t\u01B0\u1EE3ng.</td></tr><tr><td>Fill</td><td>\xA0</td><td>T\xF4 m\xE0u to\xE0n b\u1ED9 \u0111\u1ED1i t\u01B0\u1EE3ng.</td></tr><tr><td>Stroke</td><td>\xA0</td><td>T\xF4 m\xE0u \u0111\u01B0\u1EDDng vi\u1EC1n c\u1EE7a \u0111\u1ED1i t\u01B0\u1EE3ng.</td></tr><tr><td>Color Panel</td><td>\xA0</td><td>Cung c\u1EA5p b\u1EA3ng m\xE0u</td></tr><tr><td>Swatch Panel</td><td>\xA0</td><td>Thi\u1EBFt l\u1EADp b\u1EA3ng m\xE0u c\xE1 nh\xE2n ho\u1EB7c g\u1EE3i \xFD b\u1EA3ng m\xE0u li\xEAn quan.</td></tr><tr><td>Eyedropper Tool</td><td>I</td><td>Cho ph\xE9p l\u1EA5y m\u1EABu m\u1ED9t m\xE0u c\u1EE5 th\u1EC3 t\u1EEB m\u1ED9t ph\u1EA7n h\xECnh \u1EA3nh.</td></tr><tr><td>Type Tool</td><td>T</td><td>Nh\u1EADp c\xE1c d\xF2ng v\u0103n b\u1EA3n ngang ho\u1EB7c c\u0103n ch\u1EC9nh v\u0103n b\u1EA3n \u0111\u1EC3 theo \u0111\u01B0\u1EDDng d\u1EABn vect\u01A1.</td></tr><tr><td>Area Type Tool</td><td>\xA0</td><td>Hi\u1EC7u \u0111\xEDnh v\u0103n b\u1EA3n v\xE0o b\xEAn trong h\xECnh d\u1EA1ng \u0111\xE3 c\xF3.</td></tr><tr><td>Type on a path Tool</td><td>\xA0</td><td>Hi\u1EC7u \u0111\xEDnh v\u0103n b\u1EA3n l\xEAn \u0111\u01B0\u1EDDng vi\u1EC1n ho\u1EB7c ngo\xE0i \u0111\u01B0\u1EDDng vi\u1EC1n c\u1EE7a \u0111\u1ED1i t\u01B0\u1EE3ng.</td></tr><tr><td>Character Panel</td><td>\xA0</td><td>Truy c\u1EADp v\xE0o t\xF9y ch\u1EC9nh \u0111\u1ECBnh d\u1EA1ng v\u0103n b\u1EA3n (c\u1EE1, ph\xF4ng, kho\u1EA3ng c\xE1ch,\u2026)..</td></tr><tr><td>Paragraph Panel</td><td>\xA0</td><td>Thay \u0111\u1ED5i \u0111\u1ECBnh d\u1EA1ng c\u1EE7a c\xE1c c\u1ED9t v\xE0 \u0111o\u1EA1n v\u0103n (c\u0103n tr\xE1i/ ph\u1EA3i/ trung t\xE2m, kho\u1EA3ng c\xE1ch,\u2026)</td></tr><tr><td>Pathfinder</td><td>Ctrl + Shift + F9</td><td>T\u1EA1o ra h\xECnh d\u1EA1ng ph\u1EE9c t\u1EA1p t\u1EEB nhi\u1EC1u \u0111\u1ED1i t\u01B0\u1EE3ng (ph\u1ED1i h\u1EE3p, ph\xE2n chia, lo\u1EA1i tr\u1EEB,\u2026)</td></tr><tr><td>Alignment Tool</td><td>Shift F7</td><td>S\u1EAFp x\u1EBFp c\xE1c \u0111\u1ED1i t\u01B0\u1EE3ng theo tr\u1EADt t\u1EF1 mong mu\u1ED1n (c\u0103n tr\xE1i/ ph\u1EA3i/ tr\xEAn/ d\u01B0\u1EDBi/ gi\u1EEFa,\u2026)</td></tr></tbody></table><p>2.2. Th\xEAm Artboard trong Adobe Illustrator</p><p>Artboards \u0111\u01B0\u1EE3c s\u1EED d\u1EE5ng trong Adobe Illustrator \u0111\u1EC3 gi\xFAp t\u1ED5 ch\u1EE9c qu\xE1 tr\xECnh thi\u1EBFt k\u1EBF \u0111\u1ED3 h\u1ECDa. Artboards l\xE0 ph\u1EA7n kh\xF4ng gian ch\u1EE9a c\xE1c \u0111\u1ED1i t\u01B0\u1EE3ng l\xE0m vi\u1EC7c; b\u1EA5t k\u1EF3 th\u1EE9 g\xEC b\xEAn ngo\xE0i Artboard s\u1EBD kh\xF4ng \u0111\u01B0\u1EE3c \u0111\xEDnh k\xE8m khi xu\u1EA5t file.</p><p><strong>1 \u2013 Ph\u01B0\u01A1ng ph\xE1p k\xE9o v\xE0 th\u1EA3:</strong></p><p><img src="data:image/jpeg;base64," alt="C\xF4ng c\u1EE5 artboard tool trong thi\u1EBFt k\u1EBF \u0111\u1ED3 h\u1ECDa b\u1EB1ng adobe illustrator"><em>Ch\u1ECDn c\xF4ng c\u1EE5 Artboard Tool t\u1EEB khay c\xF4ng c\u1EE5 b\xEAn tr\xE1i &amp; K\xE9o v\xE0 th\u1EA3 con tr\u1ECF qua kh\xF4ng gian l\xE0m vi\u1EC7c \u0111\u1EC3 t\u1EA1o b\u1EA3ng v\u1EBD m\u1EDBi.</em></p><p><strong>2 \u2013 Ph\u01B0\u01A1ng ph\xE1p ch\xEDnh x\xE1c:</strong></p><p><img src="data:image/jpeg;base64," alt="ph\u01B0\u01A1ng ph\xE1p k\xE9o th\u1EA3 artboard"><em>Nh\u1EA5p \u0111\xFAp v\xE0o c\xF4ng c\u1EE5 Artboard Tool t\u1EEB khay c\xF4ng c\u1EE5 b\xEAn tr\xE1i; S\u1EED d\u1EE5ng menu hi\u1EC7n l\xEAn \u0111\u1EC3 thi\u1EBFt l\u1EADp chi\u1EC1u cao v\xE0 chi\u1EC1u r\u1ED9ng c\u1EE7a b\u1EA3ng v\u1EBD m\u1EDBi.</em></p><p>2.3. L\u01B0u Artboard trong Adobe Illustrator</p><p>Gi\u1EA3 s\u1EED b\u1EA1n \u0111ang l\xE0m vi\u1EC7c tr\xEAn m\u1ED9t d\u1EF1 \xE1n Thi\u1EBFt k\u1EBF \u0111\u1ED3 h\u1ECDa b\u1EB1ng Adobe Illustrator ch\u1EE9a nhi\u1EC1u Artboards. Ai \u0111\xF3 y\xEAu c\u1EA7u b\u1EA1n g\u1EEDi n\u1ED9i dung g\u1ED1c t\u1EEB m\u1ED9t trong nh\u1EEFng b\u1EA3ng v\u1EBD \u0111\xF3. D\u01B0\u1EDBi \u0111\xE2y l\xE0 c\xE1ch b\u1EA1n c\xF3 th\u1EC3 chia b\u1EA3ng v\u1EBD th\xE0nh c\xE1c t\xE0i li\u1EC7u ri\xEAng bi\u1EC7t:</p><p>B\u01B0\u1EDBc 1: Ch\u1ECDn <strong>File</strong> \u2192 <strong>Export \u2192 Export as</strong>, \u0111i\u1EC1n t\xEAn v\xE0 v\u1ECB tr\xED \u0111\u1EC3 l\u01B0u t\u1EC7p;</p><p>B\u01B0\u1EDBc 2: Trong ph\u1EA7n <strong>Format</strong>, Ch\u1ECDn <strong>Use Artboards</strong> n\u1EBFu c\xF3 \u0111\u1ED1i t\u01B0\u1EE3ng n\u1EB1m ngo\xE0i Artboard, b\u1ECF ch\u1ECDn n\u1EBFu m\u1ECDi \u0111\u1ED1i t\u01B0\u1EE3ng \u0111\u1EC1u n\u1EB1m trong Artboard;</p><p>B\u01B0\u1EDBc 3: Ch\u1ECDn <strong>All</strong> \u0111\u1EC3 l\u01B0u t\u1EA5t c\u1EA3 Artboard ho\u1EB7c nh\u1EADp <strong>Range</strong> \u0111\u1EC3 l\u1EF1a ch\u1ECDn Artboard c\u1EA7n l\u01B0u;</p><p>B\u01B0\u1EDBc 4: Ch\u1ECDn <strong>Export \u2192 OK</strong>.</p><p>2.4. L\u01B0u \u1EA3nh \u0111\u1ED9 ph\xE2n gi\u1EA3i cao trong Adobe Illustrator</p><p>\u0110\u1ED1i v\u1EDBi h\xECnh minh h\u1ECDa, thi\u1EBFt k\u1EBF \u0111\u1ED3 h\u1ECDa th\xF4ng tin ho\u1EB7c s\u1EA3n ph\u1EA9m in \u1EA5n nh\u01B0 danh thi\u1EBFp, t\xF9y ch\u1ECDn t\u1ED1t nh\u1EA5t l\xE0 l\u01B0u n\xF3 d\u01B0\u1EDBi d\u1EA1ng JPEG v\u1EDBi \u0111\u1ED9 ph\xE2n gi\u1EA3i cao v\u1EDBi c\xE1c b\u01B0\u1EDBc nh\u01B0 sau:</p><p>B\u01B0\u1EDBc 1: Ch\u1ECDn <strong>File</strong> \u2192 <strong>Export \u2192 Export as</strong>, \u0111i\u1EC1n t\xEAn t\u1EC7p v\xE0 \u0111\u1EB7t <strong>Format</strong> th\xE0nh JPEG;</p><p>B\u01B0\u1EDBc 2: Ch\u1ECDn c\xE1ch th\u1EE9c l\u01B0u artboard \u2192 <strong>Export</strong>;</p><p>B\u01B0\u1EDBc 3: T\u1EA1i ph\u1EA7n <strong>JPEG Options</strong>, h\xE3y thay \u0111\u1ED5i <strong>Color Model \u2013 Ki\u1EC3u m\xE0u</strong> n\u1EBFu c\u1EA7n v\xE0 ch\u1ECDn ch\u1EA5t l\u01B0\u1EE3ng.</p><p>B\u01B0\u1EDBc 4: Trong m\u1EE5c <strong>Options</strong>, \u0111i\u1EC1u ch\u1EC9nh <strong>Resolution</strong> \u2013 \u0111\u1ED9 ph\xE2n gi\u1EA3i \u0111\u1EA7u ra: <strong>Screen (72dpi)</strong> t\u1EA1o ra t\u1EC7p c\xF3 c\xF9ng k\xEDch th\u01B0\u1EDBc v\u1EDBi t\xE0i li\u1EC7u g\u1ED1c v\xE0 c\xF3 th\u1EC3 s\u1EED d\u1EE5ng tr\xEAn web ho\u1EB7c <strong>High (300dpi)</strong> t\u1EA1o ra h\xECnh \u1EA3nh c\xF3 \u0111\u1ED9 ph\xE2n gi\u1EA3i cao, ph\xF9 h\u1EE3p vi\u1EC7c in \u1EA5n.</p><p>B\u01B0\u1EDBc 5: Ch\u1ECDn <strong>OK</strong> \u0111\u1EC3 l\u01B0u t\u1EC7p.</p><p><img src="data:image/jpeg;base64," alt="Ki\u1EC3m tra t\xECnh tr\u1EA1ng l\u01B0u s\u1EA3n ph\u1EA9m tr\xEAn Ai"><em>Ki\u1EC3m tra t\xECnh tr\u1EA1ng l\u01B0u s\u1EA3n ph\u1EA9m tr\xEAn Ai</em></p><p>2.5. L\u01B0u \u1EA3nh \u1EDF \u0111\u1ECBnh d\u1EA1ng PNG</p><p>Khi b\u1EA1n c\u1EA7n l\u01B0u m\u1ED9t h\xECnh \u1EA3nh thi\u1EBFt k\u1EBF \u0111\u1ED3 h\u1ECDa nh\u01B0 logo ho\u1EB7c bi\u1EC3u t\u01B0\u1EE3ng \u0111\u1EC3 s\u1EED d\u1EE5ng tr\xEAn web, \u0111\u1EB7c bi\u1EC7t n\u1EBFu n\xF3 \u1EDF tr\xEAn n\u1EC1n trong su\u1ED1t, \u0111\u1ECBnh d\u1EA1ng t\u1EC7p PNG l\xE0 th\xEDch h\u1EE3p nh\u1EA5t.</p><p>B\u01B0\u1EDBc 1: Ch\u1ECDn <strong>File</strong> \u2192 <strong>Export \u2192 Export for Screen;</strong></p><p>B\u01B0\u1EDBc 2: Ch\u1ECDn <strong>tab Artboards</strong>, l\u1EF1a ch\u1ECDn Artboard mu\u1ED1n xu\u1EA5t;</p><p>B\u01B0\u1EDBc 3: Thi\u1EBFt l\u1EADp <strong>Format</strong> \u2013 \u0110\u1ECBnh d\u1EA1ng PNG v\xE0 <strong>Scale</strong> \u2013 T\u1EF7 l\u1EC7 1x;</p><p>B\u01B0\u1EDBc 4: Ch\u1ECDn <strong>Add Scale</strong> \u0111\u1EC3 c\xE0i \u0111\u1EB7t t\u1EF7 l\u1EC7 cho h\xECnh \u1EA3nh th\u1EE9 hai. V\xED d\u1EE5: Scale 3x s\u1EBD t\u1EA1o ra m\u1ED9t h\xECnh \u1EA3nh cao h\u01A1n v\xE0 r\u1ED9ng h\u01A1n ba l\u1EA7n so v\u1EDBi h\xECnh \u1EA3nh g\u1ED1c.</p><p>B\u01B0\u1EDBc 5: Th\xEAm k\xEDch c\u1EE1 n\u1EBFu c\u1EA7n.</p><p>B\u01B0\u1EDBc 6: Ch\u1ECDn <strong>Export Artboard</strong> \u0111\u1EC3 l\u01B0u h\xECnh \u1EA3nh.</p><p>2.6. H\u1ECDc c\u1EAFt gh\xE9p \u1EA3nh trong Adobe Illustrator</p><p>D\u01B0\u1EDBi \u0111\xE2y l\xE0 c\xE1c b\u01B0\u1EDBc s\u1EED d\u1EE5ng t\xF9y ch\u1ECDn <strong>crop image</strong> \u2013 c\u1EAFt \u1EA3nh trong Adobe Illustrator, l\u01B0u \xFD t\u1EA5t c\u1EA3 c\xE1c khu v\u1EF1c b\u1ECB lo\u1EA1i b\u1ECF s\u1EBD bi\u1EBFn m\u1EA5t.</p><p>B\u01B0\u1EDBc 1: Ch\u1ECDn <strong>File</strong> \u2192 <strong>Place</strong>, s\u1EED d\u1EE5ng <strong>Selection Tool</strong> ch\u1ECDn h\xECnh \u1EA3nh mu\u1ED1n x\u1EED l\xFD;</p><p>B\u01B0\u1EDBc 2: V\xE0o <strong>Control Panel \u2192 Crop Image \u2192 Object</strong>;</p><p>B\u01B0\u1EDBc 3: Th\xF4ng b\xE1o hi\u1EC3n th\u1ECB c\xE1c t\u1EC7p li\xEAn k\u1EBFt s\u1EBD \u0111\u01B0\u1EE3c nh\xFAng sau khi c\u1EAFt \u2192 <strong>OK</strong>;</p><p>B\u01B0\u1EDBc 4: \u0110i\u1EC1u ch\u1EC9nh k\xEDch th\u01B0\u1EDBc v\u1ECB tr\xED mu\u1ED1n c\u1EAFt b\u1EB1ng c\xE1ch k\xE9o c\xE1c \u0111\u01B0\u1EDDng c\u1EAFt ho\u1EB7c \u0111\u1EB7t Height (Chi\u1EC1u cao) v\xE0 Width (Chi\u1EC1u r\u1ED9ng) c\u1EE7a c\xF4ng c\u1EE5 c\u1EAFt \u1EA3nh;</p><p>B\u01B0\u1EDBc 5: Ch\u1ECDn <strong>Control Panel</strong> \u0111\u1EC3 \u0111i\u1EC1u ch\u1EC9nh c\xE1c t\xF9y ch\u1ECDn c\u1EAFt;</p><p>B\u01B0\u1EDBc 6: Ch\u1ECDn <strong>Apply \u2192 Enter/ Return</strong> \u0111\u1EC3 quay tr\u1EDF l\u1EA1i b\u1EE9c \u1EA3nh.</p>',42),o=[Q];function n(E,g){return z(),P("div",null,o)}var r=A(B,[["render",n],["__file","section2.html.vue"]]);export{r as default};
